function expectMatcher(a){function b(){expect(c.matcher().compare(c.actual,c.expected)).toEqual({pass:c.pass,message:c.message})}var c={matcher:a};return c.withActual=function(a){return c.actual=a,c},c.andExpected=function(a){return c.expected=a,c},c.toPass=function(){return c.pass=!0,c},c.toFail=function(){return c.pass=!1,c},c.withMessage=function(a){return c.message=a,b(),c},c.withSameMessage=function(){return b(),c},c}